class Solution(object):
    def numIslands(self, grid):
        """
        :type grid: List[List[str]]
        :rtype: int
        """
        if not grid:
            return 0

        row_size = len(grid)
        col_size = len(grid[0])

        neighbor_index = [(-1, 0), (1, 0), (0, -1), (0, 1)]
        
        ans = 0
        for i in range(row_size):
            for j in range(col_size):
                if grid[i][j] == '1':
                    ans += 1
                    queue = [(i, j)]
                    while queue:
                        row, col = queue.pop(0)
                        if grid[row][col] == '1':
                            grid[row][col] = '#'
                            for nei_idx in neighbor_index:
                                row_idx = row+nei_idx[0]
                                col_idx = col+nei_idx[1]
                                if row_idx >=0 and row_idx < row_size and col_idx >= 0 and col_idx < col_size and grid[row_idx][col_idx] == '1':
                                    queue.append((row_idx, col_idx))
                                    # print (row_idx, col_idx)

        return ans


